import React from 'react';
import { usePageTracking } from '../../hooks/usePageTracking';

const ApiDocs = () => {
  usePageTracking(4); // ID для страницы "API Документация"

  return (
    <div className="api-docs-container">
      <h1>API Документация</h1>
      <p>Документация API будет загружена с сервера после его настройки.</p>
      <div style={{padding: '2rem', background: '#f5f7fa', borderRadius: '8px'}}>
        <h3>Основные эндпоинты:</h3>
        <ul>
          <li><strong>GET /posts</strong> - Получение постов</li>
          <li><strong>POST /invert-image</strong> - Инверсия изображений</li>
          <li><strong>GET /kpi/</strong> - Статистика посещений</li>
          <li><strong>POST /kpi/{'{page_id}'}/visit</strong> - Запись посещения</li>
          <li><strong>POST /kpi/{'{page_id}'}/time</strong> - Запись времени</li>
        </ul>
        <p>Полная документация: http://localhost:8000/docs</p>
      </div>
    </div>
  );
};

export default ApiDocs;s
